/*
	note: disable comip-modem first in kernel, then 
	call the func to get arm926 accessable physical address value
*/
void comip_arm926_monitor()
{
	unsigned char * modem_start ;
	modem_start = (void *)ioremap(0, sizeof(acarm926_move) + 1024);

	writel(2, io_p2v(AP_PWR_CP_RSTCTL));
	memcpy(modem_start, acarm926_move , sizeof(acarm926_move));
	mdelay(1000);

	writel(0, io_p2v(CTL_CP_FUNCTION_TEST));
	writel(((2<<20) | (2<<18) | (2<<16)), io_p2v(MUX_PIN_MUX8));
	writel(0, io_p2v(CTL_AP2ARM926_INTR_SET));
	writel(0, io_p2v(AP_PWR_CP_RSTCTL));

	mdelay(100);
}

